import { store } from "..";

export const getCurrentExamId = () => {
  return store.getState().exams.currentExam.id;
};
export const getCurrentQuestionIndex = () => {
  return store.getState().exams.currentExam.currentQuestionIndex;
};

export const getCurrentQuestionId = () => {
  return store.getState().exams.byId[getCurrentExamId()].questionsById[
    getCurrentQuestionId()
  ];
};
